import Header from '../Header'
import consultantsData from '../../data/consultants.json';

import './consultants.sass'

const Consultants = () => {

    <div>TEST here</div>
    const renderConsultants = (consultants) => {
        return (
            <div className="images-container">TEST consultants
                {
                    consultants.map((consultants, idx) => {
                        return (
                            <div className="image-box" key={idx}>
                                <img 
                                src={consultants.img}
                                className="consultants-image"
                                alt="consultants" />
                                <div className="content">
                                    <p className="title">{consultants.title}</p>
                                    <p className="tech">{consultants.tech}</p>
                                    <p className="company">{consultants.company}</p>

                                    <h4 className="description">{consultants.description}</h4>
                                    <button
                                        className="btn"
                                        onClick={() => window.open(consultants.url)}
                                    >View</button>
                                </div>
                            </div>
                        )
                    })
                }
            </div>
        );
    }


    return (

        <div className='container consultants'>
            <Header />
            <h1> Consultantss</h1>
            <div>{renderConsultants(consultantsData.consultants)}</div>
        </div>

    )
}

export default Consultants
